const { default: Link } = require("next/link");

const About = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">Home</Link>
        </li>
        <li>
          <Link href="/about">About</Link>
        </li>
      </ul>
      <h1>About page in action</h1>
    </div>
  );
};

export default About;
